import React from 'react';

import { Container } from './styles';
import Button from '../Button';

export default function Header() {
  return (
    <Container >
      <div className="menu">
        <h1>BROKER<br />HUB</h1>
        <div>
          <ul>
            <li>QUEM SOMOS?</li>
            <li>OBJETIVO</li>
          </ul>
          <Button>ENTRE AGORA</Button>
        </div>
      </div>
    </Container>
  );
}
